import React from 'react';
import Profile from './profile.jsx';
import './navbar.css'; // Import the CSS file

const Navbar = () => {
  return (
    <div className="navbar">
      <h1 className="logo">Campus Connect</h1> 
      <div className="profile-container">
        <Profile />
      </div>
    </div>
  )
}

export default Navbar;
